import React, { useState } from 'react';
import './CartaFolha.css';

function CartaFolha() {
  const [isOpen, setIsOpen] = useState(false);

  const handleOnClick = () => {
    setIsOpen(!isOpen);
  };

  return (
    <div className="carta-container" onClick={handleOnClick}>
      <div className={`carta ${isOpen ? 'carta-aberta' : ''}`}>
        <div className="texto-carta">
          <p>Te amo, Jennifer! Esta é uma carta especial para você. Espero que goste e que nosso amor continue crescendo cada vez mais.</p>
        </div>
      </div>
    </div>
  );
}

export default CartaFolha;
